tables.table_schema:
CREATE TABLE criminals (
  id INT PRIMARY KEY,
  name VARCHAR(255) NOT NULL,
  age INT,
  wanted_level INT
);

CREATE TABLE stolen_identities (
  id INT PRIMARY KEY,
  owner_name VARCHAR(255) NOT NULL,
  owner_address VARCHAR(255),
  social_security_number VARCHAR(20) UNIQUE
);

CREATE TABLE criminals (
    id INT PRIMARY KEY,
    name VARCHAR(50),
    alias VARCHAR(50),
    crime VARCHAR(100)
);

CREATE TABLE stolen_identities (
    id INT PRIMARY KEY,
    owner_id INT,
    identity_type VARCHAR(50),
    identity_info JSONB
);

CREATE TABLE illegal_profit (
    id INT PRIMARY KEY,
    criminal_id INT,
    profit_amount DECIMAL(10, 2),
    profit_date DATE
);

CREATE TABLE crime_locations (
    id INT PRIMARY KEY,
    location_name VARCHAR(100),
    location_address VARCHAR(150),
    crime_type VARCHAR(100)
);
